import React, { useState } from 'react';
import axios from 'axios';
import './AddProduct.css';

function AddProduct() {
  const [name, setName] = useState('');
  const [imageURL, setImageURL] = useState('');
  const [description, setDescription] = useState('');
  const [sizeId, setSizeId] = useState({ id: 0 });
  const [price, setPrice] = useState(0);
  const [colorId, setColorId] = useState({ id: 0 });
  const [genderId, setGenderId] = useState({ id: 0 });
  const [categoryId, setCategoryId] = useState({ id: 0 });

  const handleFormSubmit = async (e) => {
    e.preventDefault();

    const productData = {
      name,
      imageURL,
      description,
      sizeId,
      price,
      colorId,
      genderId,
      categoryId,
    };

    axios
      .post('http://localhost:8080/products', productData)
      .then((response) => {
        console.log(response.data);
        alert('Proizvod je uspješno dodan.');
        // Resetirajte formu
        setName('');
        setImageURL('');
        setDescription('');
        setSizeId({ id: 0 });
        setPrice(0);
        setColorId({ id: 0 });
        setGenderId({ id: 0 });
        setCategoryId({ id: 0 });
      })
      .catch((error) => {
        console.error(error);
        alert('Došlo je do pogreške prilikom dodavanja proizvoda.');
      });
  };

  return (
    <div className="form-container">
      <h2>Dodaj proizvod</h2>
      <form onSubmit={handleFormSubmit}>
        <div>
          <label>Naziv:</label>
          <input type="text" value={name} onChange={(e) => setName(e.target.value)} />
        </div>
        <div>
          <label>URL slike:</label>
          <input type="text" value={imageURL} onChange={(e) => setImageURL(e.target.value)} />
        </div>
        <div>
          <label>Opis:</label>
          <textarea value={description} onChange={(e) => setDescription(e.target.value)} />
        </div>
        <div>
          <label>Veličina:</label>
          <input type="text" value={sizeId.id} onChange={(e) => setSizeId({ id: e.target.value })} />
        </div>
        <div>
          <label>Cijena:</label>
          <input type="number" value={price} onChange={(e) => setPrice(parseInt(e.target.value))} />
        </div>
        <div>
          <label>ID boje:</label>
          <input type="number" value={colorId.id} onChange={(e) => setColorId({ id: e.target.value })} />
        </div>
        <div>
          <label>ID spola:</label>
          <input type="number" value={genderId.id} onChange={(e) => setGenderId({ id: e.target.value,name:genderId.name })} />
        </div>
        <div>
          <label>ID kategorije:</label>
          <input type="number" value={categoryId.id} onChange={(e) => setCategoryId({ id: e.target.value })} />
        </div>
        <button type="submit">Dodaj</button>
      </form>
    </div>
  );
}

export default AddProduct;
